@MrUnpopular
Believe it or not, this is cheaper than my old ISP.
My old ISP gave me 4MB/s down, 190kbps up. $40 cheaper now with all this extra stuff(TV, Phone, blah). Now I have 10.5MB/s down, 5MB/s up, and about 200 more TV channels. I have zero idea why I didn't upgrade years ago. I'm only paying $163 a month for 1000 TV channels, digital phone, and this internet, opposed to the $200 before.
